import React, { Component } from 'react';

class Authors extends Component {
  constructor(props) {
    super(props);
    this.state = { books: [] };
  }

  render() {
    const { authors } = this.props;
    const { books } = this.state;

    return (
      <React.Fragment>
        {authors.map(author => {
          return <p>{author.id}</p>;
        })}
      </React.Fragment>
    );
  }
}
export default Authors;
